selector_to_html = {"a[href=\"#simple-ligninger-med-broker\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3.1.1. </span>Simple ligninger med br\u00f8ker<a class=\"headerlink\" href=\"#simple-ligninger-med-broker\" title=\"Permalink til denne overskrift\">#</a></h3><p>Har vi ligninger der indeholder br\u00f8ker, s\u00e5 skal vi v\u00e6re opm\u00e6rksomme, som vi ogs\u00e5 s\u00e5 i <a class=\"reference internal\" href=\"grundmaengder.html#grundmaengder\"><span class=\"std std-numref\">Kapitel 3.2</span></a>. Det beh\u00f8ver vi dog ikke n\u00f8dvendigvis at v\u00e6re, hvis ikke <span class=\"math notranslate nohighlight\">\\(x\\)</span>\u2019et st\u00e5r i n\u00e6vneren. For eksempel</p>", "a[href=\"#simple-ligninger-med-rodder\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3.1.3. </span>Simple ligninger med r\u00f8dder<a class=\"headerlink\" href=\"#simple-ligninger-med-rodder\" title=\"Permalink til denne overskrift\">#</a></h3><p>Vi kan ogs\u00e5 m\u00f8de ligninger p\u00e5 formen</p>", "a[href=\"#simpelligninguligegrad\"]": "<div class=\"proof eksempel admonition\" id=\"simpelligninguligegrad\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 3.7 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os l\u00f8se ligningen:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    x^3 - 1 = 124\\]</div>\n<p>F\u00f8rst bestemmer vi grundm\u00e6ngden. Eftersom vi ikke har r\u00f8dder eller br\u00f8ker i vores oprindelige ligningsudtryk, s\u00e5 m\u00e5 <span class=\"math notranslate nohighlight\">\\(G=\\mathbb{R}\\)</span>. Vi l\u00f8ser dern\u00e6st ligningen</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n&amp;                &amp;  x^3 - 1 &amp;= 124     &amp;   &amp;\\text{L\u00e6g 1 til p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x^3 \\cancel{-1} \\cancel{+1} &amp;= 124 + 1      &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x^3 &amp;= 125               &amp;   &amp;\\text{Tag $\\sqrt[3]{\\ }$ p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\sqrt[\\cancel{3}]{x^{\\cancel{3}}} &amp;= \\sqrt[3]{125} &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x &amp;= 5                    &amp;   &amp; \n\\end{align*}\n\\end{split}\\]</div>\n<p>Vi laver vores kontrol. Inds\u00e6t <span class=\"math notranslate nohighlight\">\\(x=5\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n\\begin{align*}\n&amp; 5^3 - 1 = 125 - 1 = 124\n\\end{align*}\n\\]</div>\n<p>L\u00f8sningen giver, at venstre- og h\u00f8jresiden af ligningen er identiske.</p>\n</section>\n</div>", "a[href=\"lighed-og-ligevaegt.html#lighedogligevaegt\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.1. </span>Lighed, ligev\u00e6gtsprincip og \u00e6kvivalens<a class=\"headerlink\" href=\"#lighed-ligevaegtsprincip-og-aekvivalens\" title=\"Permalink til denne overskrift\">#</a></h1><p>Ligninger er matematiske udtryk, der indeholder et lighedstegn og en ubekendt, som er den, vi er interesseret i at bestemme. Oftest kalder vi den ubekendte for <span class=\"math notranslate nohighlight\">\\(x\\)</span>. For eksempel er</p>", "a[href=\"grundmaengder.html#grundmaengder\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.2. </span>Grundm\u00e6ngder<a class=\"headerlink\" href=\"#grundmaengder\" title=\"Permalink til denne overskrift\">#</a></h1><p>Noget nyt, som du sikkert ikke har v\u00e6ret vant til at t\u00e6nke over, er hvilke v\u00e6rdier for den ubekendte variable, for eksempel <span class=\"math notranslate nohighlight\">\\(x\\)</span>, n\u00e5r vi arbejder med ligninger. De v\u00e6rdier, som vi m\u00e5 arbejde med, kalder vi ligningens <em>grundm\u00e6ngde</em> og betegnes <span class=\"math notranslate nohighlight\">\\(G\\)</span>. Den skal bestemmes inden, at du g\u00e5r i kast med at l\u00f8se ligningen.</p><p>Forestil dig, at du ikke ved, hvordan du vil l\u00f8se en ligning, men bare pr\u00f8ve at inds\u00e6tte forskellige v\u00e6rdier for <span class=\"math notranslate nohighlight\">\\(x\\)</span> ind i en ligning indtil, at du finder den rigtige v\u00e6rdi. Kigger vi s\u00e5 p\u00e5 ligningen</p>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3.2. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#simpelligningligegrad\"]": "<div class=\"proof eksempel admonition\" id=\"simpelligningligegrad\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 3.8 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os l\u00f8se ligningen:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    4x^2 + 12 = 268\\]</div>\n<p>F\u00f8rst bestemmer vi grundm\u00e6ngden. Eftersom vi ikke har r\u00f8dder eller br\u00f8ker i vores oprindelige ligningsudtryk, s\u00e5 m\u00e5 <span class=\"math notranslate nohighlight\">\\(G=\\mathbb{R}\\)</span>. Vi l\u00f8ser dern\u00e6st ligningen</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n&amp;                &amp;  4x^2 + 12 &amp;= 268     &amp;   &amp;\\text{Tr\u00e6k 12 fra p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  4x^2 \\cancel{+12} \\cancel{-12} &amp;= 268 - 12      &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  4x^2 &amp;= 256               &amp;   &amp;\\text{Dvid\u00e9r med 4 p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\frac{\\cancel{4}x^2}{\\cancel{4}} &amp;= \\frac{256}{4} &amp; &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x^2 &amp;= 64           &amp;   &amp;\\text{Tag $\\sqrt{\\ }$ p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\sqrt{x^{\\cancel{2}}} &amp;= \\pm \\sqrt{64} &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  x &amp;= \\pm 8                    &amp;   &amp; \n\\end{align*}\n\\end{split}\\]</div>\n<p>Bem\u00e6rk, at vi har to l\u00f8sninger, nemlig <span class=\"math notranslate nohighlight\">\\(x=8\\)</span> eller <span class=\"math notranslate nohighlight\">\\(x=-8\\)</span>. Det skyldes, at n\u00e5r vi har en lige eksponent, s\u00e5 vil b\u00e5de et tal og det modsatte tal give samme potens. Lad os lave vores kontrol med begge l\u00f8sninger og overbevise, at dette g\u00e6lder generelt.</p>\n<p>Inds\u00e6t <span class=\"math notranslate nohighlight\">\\(x=8\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n\\begin{align*}\n&amp; 4\\cdot 8^2 + 12 = 4\\cdot 64 + 12 = 256 + 12 = 268\n\\end{align*}\n\\]</div>\n<p>Inds\u00e6t nu <span class=\"math notranslate nohighlight\">\\(x=-8\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\n\\begin{align*}\n&amp; 4\\cdot (-8)^2 + 12 = 4\\cdot 64 + 12 = 256 + 12 = 268\n\\end{align*}\n\\]</div>\n<p>L\u00f8sningerne giver, at venstre- og h\u00f8jresiden af ligningen er identiske.</p>\n</section>\n</div>", "a[href=\"#en-ligning-med-en-ubekendt\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3. </span>En ligning med en ubekendt<a class=\"headerlink\" href=\"#en-ligning-med-en-ubekendt\" title=\"Permalink til denne overskrift\">#</a></h1><p>I folkeskolen l\u00e6rte du at l\u00f8se en ligning med en ubekendt. I n\u00e6ste kapitel skal du l\u00e6re at l\u00f8se to ligninger med to ubekendte.</p><p>N\u00e5r vi snakker om ligninger, s\u00e5 er vi vant til, at den ubekendte er <span class=\"math notranslate nohighlight\">\\(x\\)</span>. I bund og grund kan den ubekendte tage mange former og beh\u00f8ver ikke v\u00e6re <span class=\"math notranslate nohighlight\">\\(x\\)</span>. Det kommer an p\u00e5 konteksten, for mange gange kan det give mening, at det er et bestemt bogstav, der bruges som den ubekendte. For eksempel, hvis en rektangel har arealet 16 og l\u00e6ngde 3, s\u00e5 kan vi hurtigt bestemme, at bredden er 6. Vi kender jo arealformlen for et rektangel <span class=\"math notranslate nohighlight\">\\(A=lb\\)</span>, fra folkeskolen. S\u00e5 det, som vi faktisk g\u00f8r, er, at vi opstiller ligningen</p>", "a[href=\"#loesningfoerstegrad\"]": "<div class=\"proof s\u00e6tning admonition\" id=\"loesningfoerstegrad\">\n<p class=\"admonition-title\"><span class=\"caption-number\">S\u00e6tning 3.1 </span> (L\u00f8sningsformlen for f\u00f8rstegradsligninger)</p>\n<section class=\"s\u00e6tning-content\" id=\"proof-content\">\n<p>Givet er en ligning p\u00e5 formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    ax+b=0,\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(a\\neq 0\\)</span>. Da er l\u00f8sningen til ligningen givet ved</p>\n<div class=\"math notranslate nohighlight\">\n\\[    x = -\\frac{b}{a}.\\]</div>\n</section>\n</div>", "a[href=\"#loesningfoerstegrad2\"]": "<div class=\"proof korollar admonition\" id=\"loesningfoerstegrad2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Korollar 3.1 </span></p>\n<section class=\"korollar-content\" id=\"proof-content\">\n<p>Givet er en ligning p\u00e5 formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    ax+b=c,\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(a\\neq 0\\)</span>. Da er l\u00f8sningen til ligningen givet ved</p>\n<div class=\"math notranslate nohighlight\">\n\\[    x = \\frac{c-b}{a}.\\]</div>\n</section>\n</div>", "a[href=\"#simple-ligninger-med-hojere-ordens-led\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3.1.2. </span>Simple ligninger med h\u00f8jere ordens led<a class=\"headerlink\" href=\"#simple-ligninger-med-hojere-ordens-led\" title=\"Permalink til denne overskrift\">#</a></h3><p>Som vi har set, s\u00e5 var simple ligninger nogle, der kunne reduceres ned p\u00e5 formen af f\u00f8rstegradsligninger</p>", "a[href=\"#simple-ligninger\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.3.1. </span>Simple ligninger<a class=\"headerlink\" href=\"#simple-ligninger\" title=\"Permalink til denne overskrift\">#</a></h2><p>Et eksempel p\u00e5 \u00e9n ligning med \u00e9n ubekendt kunne v\u00e6re</p>", "a[href=\"#enligningenubekendteks1\"]": "<div class=\"proof eksempel admonition\" id=\"enligningenubekendteks1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 3.4 </span></p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os l\u00f8se ligningen:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    2(x-8)+4x-12=2-3(2-4x)\\]</div>\n<p>F\u00f8rst skal vi bestemme grundm\u00e6ngden. Eftersom, der hverken er br\u00f8ker eller r\u00f8dder i ligningen, s\u00e5 ser vi, at <span class=\"math notranslate nohighlight\">\\(G=\\mathbb{R}\\)</span>.</p>\n<p>Ligningen ser forholdsvis kompliceret ud, men vi kan reducere den til noget, som er nemmere at have med at g\u00f8re. Det g\u00f8r vi ved f\u00f8rst at ordne ligningen. Det betyder, at vi regner parenteserne ud og samler alt, der har med <span class=\"math notranslate nohighlight\">\\(x\\)</span> at g\u00f8re p\u00e5 den ene side og resten p\u00e5 den anden side af lighedstegnet. En god huskeregel er at samle <span class=\"math notranslate nohighlight\">\\(x\\)</span>\u2019erne p\u00e5 den side af lighedstegnet, hvor der er flest af dem.</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n&amp;                &amp;  2(x-8)+4x-12 &amp;= 2-3(2-4x)     &amp;   &amp;\\text{Udregn parenteserne} \\\\\n&amp;\\Leftrightarrow &amp;  2x-16+4x-12 &amp;= 2-6+12x        &amp;   &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  6x-28 &amp;= -4+12x               &amp;   &amp;\\text{Saml $x$'erne p\u00e5 h\u00f8jresiden} \\\\\n&amp;\\Leftrightarrow &amp;  \\cancel{6x}-28\\cancel{-6x} &amp;= -4+12x-6x &amp;   &amp;\\text{Saml resten p\u00e5 venstresiden} \\\\\n&amp;\\Leftrightarrow &amp;  -28+4  &amp;= \\cancel{-4}+12x-6x\\cancel{+4} &amp;  &amp;\\text{Reduc\u00e9r begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  -24 &amp;= 6x                     &amp;   &amp;\\text{Divid\u00e9r med 6 p\u00e5 begge sider} \\\\\n&amp;\\Leftrightarrow &amp;  \\frac{-24}{6} &amp;= \\frac{\\cancel{6}x}{\\cancel{6}} &amp;   &amp;\\text{Regn br\u00f8ken p\u00e5 venstresiden} \\\\\n&amp;\\Leftrightarrow &amp;  -4 &amp;= x\n\\end{align*}\n\\end{split}\\]</div>\n<p>Det er altid en god id\u00e9 at lave en kontrol. Lad os inds\u00e6tte <span class=\"math notranslate nohighlight\">\\(x=-4\\)</span> i vores oprindelige ligningsudtryk:</p>\n<div class=\"math notranslate nohighlight\">\n\\[\\begin{split}\n\\begin{align*}\n&amp; 2(-4-8)+4\\cdot(-4)-12 &amp; -24 - 16 - 12 = -52 \\\\\n&amp; 2-3(2-4\\cdot(-4))=2-3(2+16) = -52\n\\end{align*}\n\\end{split}\\]</div>\n<p>L\u00f8sningen giver, at venstre- og h\u00f8jresiden af ligningen er identiske.</p>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
